INSERT INTO `turnaje` (`turnaj_id`, `nazev`, `popis`, `prvni_cena_id`, `druha_cena_id`, `treti_cena_id`, `kapacita`, `zapisne`, `min_uroven`, `obtiznost`, `start`, `otevreno`) VALUES
(1, 'Velký jarní turnaj 2020', 'Turnaj odehrávající se pouze jednou za rok. Pojďte oslavit příchod jara a získejte šanci vyhrát skvělé ceny.', 3, 2, 3, 64, 500000, 15, 8, '2020-03-21 17:00:00', 1),
(2, 'Velký letní turnaj 2020', 'Léto, to znamená teplo, slunce... a spoustu závodění a skvělých výher! Pojďte soutěžit o úžasné výhry v turnaji, který se uskutečňuje pouze jednou za rok.', 4, 2, 3, 64, 500000, 15, 8, '2020-06-21 17:00:00', 0),
(3, 'Velký podzimní turnaj 2020', 'Léto je již za námi, to ale neznamená ze uklidíme svá vozidla do garáží. I závody mezi padajícím listím mohou být zábavné. Přihlaste se do turnaje, který se koná jen jednou za rok a získejte šanci vyhrát úžasné výhry!', 5, 2, 3, 64, 500000, 15, 8, '2020-09-23 17:00:00', 0),
(5, 'Zlatý volant 2020', 'Nejprestižnější, nejtěžší a nejúžasnější turnaj celého roku s těmi nejúžasnějšími výhrami. Přihlaste se a ukažte, že právě vy jste nejlepším řidičem na světě.', 1, 2, 3, 16, 1000000, 20, 10, '2020-02-29 12:00:00', 1),
(6, 'Vánoční turnaj 2020', 'Tak tu zase máme Vánoce! A s nimi i náš tradiční Vánoční turnaj. Zúčastněte se a vyhrajte unikátní vozidlo, které vám bude vaše vítězství připomínat i v budoucnu.', 2, 2, 3, 64, 300000, 7, 5, '2020-12-24 12:00:00', 1),
(7, 'Novoroční turnaj 2020', 'Nový rok je tady! Pokud jste toho v noci moc nevypily, jste slibným kandidátem na vítězství v novoročním turnaji. Nepropásněte svou příležitost!', 12, 2, 3, 64, 250000, 12, 6, '2020-01-01 10:00:00', 1),
(9, 'Grand Prix Leden 2020', 'Čas na pravidelný měsíční turnaj. Ukažte, co je ve vás a jak jste se od posledního měsíce zlepšili.', 20, 21, 22, 32, 100000, 10, 4, '2020-01-18 19:00:00', 1),
